import React from 'react';
import logo from './logo.svg';
import './App.css';
import practiceCode from './practiceCode/code'
import { Route, Router, Switch } from 'react-router-dom';

function App() {
  return (
    <div className='background' >
      <div>
        <Router>
          <Switch>
            <Route path='./' component={practiceCode}></Route>
          </Switch>
        </Router>
        <ul>
        <li><a href="default.asp">About</a></li>
          {/* <li><a href="news.asp">Pra</a></li> */}
          {/* <li><a href="contact.asp">Contact</a></li> */}
          <li><a href="about.asp">Practice Code</a></li>
        </ul>
      </div>
    </div>

  );
}

export default App;
